dition',86,0,0,0,'+        start_gui()'),(27,'addition',87,0,0,0,'+        while is_process_running(gui.pid):'),(27,'addition',88,0,0,0,'+            time.sleep(10)'),(27,'addition',89,0,0,0,'+            if notified():'),(27,'addition',90,0,0,0,'+                break'),(27,'addition',91,0,0,1,'+'),(27,'addition',92,0,0,0,'+    start_server()'),(27,'addition',93,0,0,1,'+'),(27,'addition',94,0,0,0,'+    driver = open_browser()'),(27,'addition',95,0,0,0,'+    open = True'),(27,'addition',96,0,0,0,'+    while open:'),(27,'addition',97,0,0,0,'+        time.sleep(1)'),(27,'addition',98,0,0,0,'+        open = browser_is_open(driver)'),(27,'addition',99,0,0,1,'+'),(27,'addition',100,0,0,0,'+    shutdown_server()'),(27,'addition',101,0,0,1,'+'),(27,'addition',102,0,0,0,'+if __name__ == \"__main__\":'),(27,'addition',103,0,0,0,'+    main()'),(29,'addition',1,0,0,0,'+# Bus Factor Analyzer'),(29,'addition',2,0,0,1,'+'),(29,'addition',3,0,0,0,'+###How To'),(29,'addition',4,0,0,1,'+'),(29,'addition',5,0,0,0,'+In order to run the tool you need to perform some steps:'),(29,'addition',6,0,0,1,'+'),(29,'addition',7,0,0,0,'+1) Install Gitana (https://github.com/valeriocos/Gitana) '),(29,'addition',8,0,0,1,'+'),(29,'addition',9,0,0,0,'+2) Launch the Gitana GUI (gitana_gui.py) and extract your Git repository to a relational database'),(29,'addition',10,0,0,1,'+'),(29,'addition',11,0,0,0,'+3) Export the obtained relational database to JSON (always through the Gitana GUI)'),(29,'addition',12,0,0,1,'+'),(29,'addition',13,0,0,0,'+4) Launch the Bus Factor Analyzer GUI (https://github.com/valeriocos/BusFactor/blob/master/bus_factor_gui.py)'),(29,'addition',14,0,0,1,'+'),(29,'addition',15,0,0,0,'+5) Select the path of the JSON file where the relational database has been exported'),(29,'addition',16,0,0,1,'+'),(29,'addition',17,0,0,0,'+6) When the export has finished, execute tool.py (https://github.com/valeriocos/BusFactor/blob/master/tool.py) to visualize the result'),(29,'addition',18,0,0,1,'+'),(29,'addition',19,0,0,1,'+'),(29,'addition',20,0,0,0,'+###Settings'),(29,'addition',21,0,0,1,'+'),(29,'addition',22,0,0,0,'+The Bus Factor Analyzer GUI allows you to tune the process to assess the bus factor for your Git repository. '),(29,'addition',23,0,0,0,'+In particular you will be able to play with:'),(29,'addition',24,0,0,1,'+'),(29,'addition',25,0,0,0,'+- **Primary developer knowledge.** '),(29,'addition',26,0,0,0,'+Primary developers are those developers that have modified a minimum percentage X of a software artifact (e.g., file, '),(29,'addition',27,0,0,0,'+directory, branch, file extension) of the repository. By default, X is set to 1/D, where D is the overall number of developers that have ever'),(29,'addition',28,0,0,0,'+modified the artifact. However, X can be changed to be, for instance, 1/2 (50% of the modifications over the artifact), 1/4 (25%) and so on.'),(29,'addition',29,0,0,1,'+'),(29,'addition',30,0,0,0,'+- **Secondary developer knowledge.**'),(29,'addition',31,0,0,0,'+Secondary developers are those developers that know at least a proportion Y of what the primary developers know (X). By default,'),(29,'addition',32,0,0,0,'+Y is set to half of X (0.5), however it can be changed to a value between 0 and 1. In case you don\'t want to use '),(29,'addition',33,0,0,0,'+the secondary developer knowledge parameter, you can set Y to 1.'),(29,'addition',34,0,0,1,'+'),(29,'addition',35,0,0,0,'+- **Detail level.**'),(29,'addition',36,0,0,0,'+This parameter allows you to set the the granularity of the analysis, that can be based on developer modifications at file or line level.'),(29,'addition',37,0,0,1,'+'),(29,'addition',38,0,0,0,'+- **Metric.**'),(29,'addition',39,0,0,0,'+This parameter is used to combine the importance of the number and order of modifications to assign the knowledge value. '),(29,'addition',40,0,0,0,'+Note that depending on the level of detail selected, the four metrics are initially calculated at file or line level (just for text files).'),(29,'addition',41,0,0,0,'+Once the selected metric has been calculated, its calculation is repeated at each level of the repository to assign a bus factor value'),(29,'addition',42,0,0,0,'+to each directory, branch, file extension and the repository itself.'),(29,'addition',43,0,0,1,'+'),(29,'addition',44,0,0,0,'+ - **Last change.** This metric assigns all knowledge of a line/file to the last developer that modified that'),(29,'addition',45,0,0,0,'+line (or file for binary files).'),(29,'addition',46,0,0,1,'+'),(29,'addition',47,0,0,0,'+ - **Multiple changes.** This metric counts the number of times a line/file has been modified during the life-cycle of the project. '),(29,'addition',48,0,0,0,'+ It assigns more knowledge to the developers that modified the line/file most times.'),(29,'addition',49,0,0,1,'+'),(29,'addition',50,0,0,0,'+ - **Distinct changes**. This metric assesses the developer knowledge according to the number of non-consecutive changes on the line/file.'),(29,'addition',51,0,0,1,'+ '),(29,'addition',52,0,0,0,'+ - **Weighted distinct changes.** This metric assesses the developer knowledge by relying of the previous metric modified to take into account the position of the'),(29,'addition',53,0,0,0,'+modifications in the time-line evolution of the line/file. It is used to assign an incremental importance to the later modifications'),(29,'addition',54,0,0,0,'+on the line/file.'),(30,'addition',3,0,0,0,'+The tool is the result of the ongoing work published in the 22nd IEEE International Conference on Software Analysis, Evolution, and Reengineering (available for download at http://tinyurl.com/AssessingBusFactorForGitRepo). We would be very interested in getting feedback and helping people use it.'),(30,'addition',4,0,0,1,'+'),(31,'addition',57,0,0,1,'+'),(31,'addition',58,0,0,0,'+###Demo'),(31,'addition',59,0,0,1,'+'),(31,'addition',60,0,0,0,'+A demo of the tool is available at https://github.com/atlanmod/busfactor_demo'),(32,'addition',577,0,0,0,'+        del bus_factor_per_ref'),(32,'addition',579,0,0,0,'+        bus_factor_per_directory = self.get_bus_factor_per_directory()'),(32,'addition',583,0,0,0,'+        del bus_factor_per_directory'),(32,'addition',585,0,0,0,'+        bus_factor_per_file = self.get_bus_factor_per_file()'),(32,'addition',589,0,0,0,'+        del bus_factor_per_file'),(32,'addition',591,0,0,0,'+        bus_factor_per_extension = self.get_bus_factor_per_extension()'),(32,'addition',595,0,0,0,'+        del bus_factor_per_extension'),(32,'addition',597,0,0,0,'+        user_relevance = self.get_user_relevance()'),(32,'addition',601,0,0,0,'+        del user_relevance'),(32,'addition',603,0,0,0,'+        extension_relevance = self.get_extensions_relevance()'),(32,'addition',607,0,0,0,'+        del extension_relevance'),(32,'addition',609,0,0,0,'+        project_info = self.get_project_info()'),(32,'addition',613,0,0,0,'+        del project_info'),(32,'deletion',572,0,0,0,'-        bus_factor_per_file = self.get_bus_factor_per_file()'),(32,'deletion',573,0,0,0,'-        bus_factor_per_directory = self.get_bus_factor_per_directory()'),(32,'deletion',575,0,0,0,'-        bus_factor_per_extension = self.get_bus_factor_per_extension()'),(32,'deletion',576,0,0,0,'-        user_relevance = self.get_user_relevance()'),(32,'deletion',577,0,0,0,'-        extension_relevance = self.get_extensions_relevance()'),(32,'deletion',578,0,0,0,'-        project_info = self.get_project_info()'),(32,'deletion',579,0,0,1,'-'),(33,'addition',57,0,0,1,'+'),(33,'addition',58,0,0,0,'+###Demo'),(33,'addition',59,0,0,1,'+'),(33,'addition',60,0,0,0,'+A demo of the tool is available at https://github.com/atlanmod/busfactor_demo');
